import React, { useState, useEffect } from "react";
import { useParams, NavLink } from "react-router-dom";
import styled from "styled-components";
import Rating from "./Rating";
import { tablet } from "../Responsive";
import { useDispatch, useSelector } from "react-redux";
import Products from "./Products";
import LoadingBox from "./LoadingBox";
import MessageBox from "./MessageBox";
import { productDetail } from "../redux/action";

const Wrapper = styled.div`
  min-height: 50vh;
  .row {
    width: 100%;
    display: grid;
    grid-template-columns: 100%;
    gap: 10px;
    margin: 1rem;
    min-height: 60vh;
    ${tablet({ gridTemplateColumns: "40% 60%" })}
  }
  .img-container {
    width: 100%;
    height: 250px;
  }

  img {
    width: 100%;
    height: 100%;
    border-radius: 10px;
  }

  .content {
    display: grid;
    grid-template-columns: 100%;
    gap: 10px;
    ${tablet({ gridTemplateColumns: "60% 40%" })}
  }
  .desc {
  }
  .addtocart {
    background-color: gray;
    color: white;
    width: 90%;
    height: 250px;
    padding: 10px;
    /* ${tablet({ position: "absolute", right: "20px" })} */
  }
  button {
    background-color: yellow;
    width: 90%;
  }
  .rating,
  .addtocart p {
    margin-bottom: 6px;
  }

  .rating span {
    color: #f0c040;
    margin: 0.1rem 0;
    font-size: 0.8rem;
  }
  .rating span:last-child {
    color: #404040;
  }
  .status {
    width: 100%;
  }

  .relateditem {
    display: grid;
    grid-template-columns: 50% 50%;
    gap: 5px;
    margin: 1rem;
    ${tablet({ gridTemplateColumns: "25% 25% 25% 25%" })}
  }
`;

function Product(props) {
  const { id } = useParams();
  const [qty, setQty] = useState(1);

  const dispatch = useDispatch();
  const singleProduct = useSelector((state) => state.singleProduct);
  const { loading, error, product } = singleProduct;

  useEffect(() => {
    dispatch(productDetail(id));
  }, [dispatch, id]);

  // const handleAddToCart = () => {
  //   props.history.push(`/cart/${id}?qty={qty}`);
  // };

  return (
    <Wrapper>
      {loading ? (
        <LoadingBox></LoadingBox>
      ) : error ? (
        <MessageBox>{error}</MessageBox>
      ) : (
        product && (
          <>
            <div className="row">
              <div className="img-container">
                <img src={product.image} alt={product.name} />
              </div>
              <div className="content">
                <div className="desc">
                  <h4>Addidas Fit Shirt</h4>
                  <Rating
                    rating={product.rating}
                    numReviews={product.numReviews}
                  />
                  <div className="price">
                    <p>Price: ${product.price}</p>
                    <p>Description: {product.description}</p>
                  </div>
                </div>
                <div className="addtocart">
                  <p>Seller</p>
                  <p>{product.brand}</p>
                  <Rating
                    rating={product.rating}
                    numReviews={product.numReviews}
                  />
                  <p>
                    Price <span>${product.price}</span>
                  </p>
                  <p className="status">
                    Status{" "}
                    {product.countInStock > 0 ? (
                      <span className="text-success text-right">In Stock</span>
                    ) : (
                      <span className="text-danger text-right">
                        Unavailable
                      </span>
                    )}
                  </p>
                  <div className="qty">
                    <div>Qty</div>
                    <div>
                      {/* <select
                        value={qty}
                        onChange={(e) => setQty(e.target.value)}
                      >
                        {[...Array(product.countInStock.keys())].map((x) => (
                          <option key={x + 1} value={x + 1}>
                            {x + 1}
                          </option>
                        ))}
                      </select> */}
                    </div>
                  </div>
                  {product.countInStock > 0 && (
                    <>
                      <button>Add to Cart</button>
                    </>
                  )}
                </div>
              </div>
            </div>
          </>
        )
      )}
      <div className="related">
        <h4>Related Products</h4>
        <div className="relateditem">{Products && <Products />}</div>
      </div>
    </Wrapper>
  );
}

export default Product;
